  return (
    <div className={s.item}>
      <img src={`http://localhost:3333${image}`} alt={title} />
        <p>{title}</p>
        <div className={s.count}>
        <div className={s.btn}>+</div>
        <p>{count}pc</p>
        <div className={s.btn}>-</div>
        </div>

    </div>
  )
}


